syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";



message ReliquaryUpgradeRsp {
	uint64 target_reliquary_guid = 4;
	int32 retcode = 13;
	uint32 power_up_rate = 6;
	uint32 old_level = 11;
	uint32 cur_level = 8;
	repeated uint32 cur_append_prop_list = 7;
	repeated uint32 old_append_prop_list = 9;
}